// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "openzeppelin-solidity/contracts/token/ERC721/ERC721.sol";

contract Car is ERC721 {
    uint256 public tokenIdCounter;
    mapping(uint256 => string) private _chasisNumbers;
    mapping(uint256 => string) private _descriptions;

    constructor(string memory _name, string memory _symbol) ERC721(_name, _symbol) {
        tokenIdCounter = 1;
    }

    function mintNFT(string memory _chasisNumber, string memory _description) external {
        _chasisNumbers[tokenIdCounter] = _chasisNumber;
        _descriptions[tokenIdCounter] = _description;
        _safeMint(msg.sender, tokenIdCounter);
        tokenIdCounter++;
    }

    function getChasisNumber(uint256 _tokenId) external view returns (string memory) {
        return _chasisNumbers[_tokenId];
    }

    function getDescription(uint256 _tokenId) external view returns (string memory) {
        return _descriptions[_tokenId];
    }
}
